INSERT INTO entity.entities (entity_id, address1, address2, city, state_id, country_id, zip_code, phone, fax, metadata) VALUES (577, '10720 Red Rock Road', NULL, 'Reno', 34, 231, '89506', '(775) 972-3705', NULL, '{"notes": "Provo River, 40 samples, get,id; Customer originally called \"Elizabeth Amen\". This appeared to have been a misspelling of \"Elisabeth Ammon\" based on address and phone searches on the internet. She was a grad student of Peter Stacey at University of Nevada, Reno, but this project seems to be independent/after. The sampling dates were all in 1999. An article with the closest date after the samples were take is Rood et all 2003 in which her contact information is listed as: Elisabeth M. Ammon is the science director of the Great Basin Bird Observatory, Reno, NV 89501. The Provo River restoration documents do not list here affiliation, simply that she is a practicing biologist for 12 years (http://www.usbr.gov/uc/envdocs/ea/victory_ranch/Draft_victory_ranch.pdf). Therefore, this customer was called \"Victory River Ranch Restoration\", the title of the EA project for which the samples were collected.; OldCustID: ELIZ-AMEN; OldCustName: Elizabeth Amen", "Group": "Other Agencies & Organizations"}');
