INSERT INTO entity.entities (entity_id, address1, address2, city, state_id, country_id, zip_code, phone, fax, metadata) VALUES (268, 'Wenatchee Forestry Sciences Lab', '1133 N Western Ave', 'Wenatchee', 48, 231, '98801', '(509) 664-1741', NULL, '{"notes": "For each sample, sort a 600 count random subsample, plus the big/rare search. In the online sorting methods, it states that pupae are not counted but set aside. There may be a number of caddisfly pupa, which may or may not be included in the count, but I would like to have if identifiable. Please sort invertebrates into separate vials of major taxonomic orders. Return un-sorted proportions of samples along with sorted invertebrates. Thank you!"}');
